    setSorted(sorted => !sorted)
  }


  return (
    <div className="search">
      <input type="text" className="searchTerm" onChange = {(e) => setSearch(e.target.value)} />
      <input type="checkbox" onClick = {handleChange}/> Sort
    </div>
  );
}

